import React from 'react';
import { BrowseRouter as Router, Route, Switch } from "react-router-dom";
import Jumbotron from "./components/Jumbotron/jumbotron";
import Table from "./components/Table/table"

function App() {
  return (
    <Router>
    <div>
      <Jumbotron/>
      <Table />
      </div>
      </Router>
  );
}

export default App;
